import React from "react"
import PrimarySearchAppBar from "../../component/navbar/Navbar"
import { Box, Typography } from "@mui/material"
import styled from "styled-components"
import "./Homescreen.css"

import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';






const SectionFirst=styled(Box)`
  position: relative;
  top: 73px;



`
const BoxFirst = styled(Box)`
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  margin-top: 12px;
  border-bottom: 1px solid #8080807d;
`
const HomeSection=styled(Box)`
  margin-top: 12px;
  height: 100vh;
  width: 100%;
  position: relative;
`


export const HomeScreen = () => {


  const [value, setValue] = React.useState('one');

  const handleChange = (event: React.SyntheticEvent, newValue: string) => {
    setValue(newValue);
  };
  return (
    <>
      <PrimarySearchAppBar></PrimarySearchAppBar>
      <SectionFirst>
        <BoxFirst >
          <Box>
            <Typography variant="subtitle1" sx={{fontFamily:"cursive" ,fontStyle:"italic"}} >Mobile</Typography>
          </Box>

        </BoxFirst>
        </SectionFirst>
        <HomeSection>
          <div className="backHomeImg">

          </div>
        </HomeSection>



    <Box sx={{ width: '100%' ,display:"flex",flexDirection:"column" ,justifyContent:"space-evenly"}}>
      <Tabs
        value={value}



        indicatorColor="secondary"


      >
        <Tab value="one" label="Item One" />
        <Tab value="two" label="Item Two" />
        <Tab value="three" label="Item Three" />
      </Tabs>
    </Box>





    </>
  )
}

const header=[{
  path:'',
  title:'Mobile'
},{
  path:'',
  title:'Electronic'
},
{
  path:'',
  title:'Mobile'
}
]
